// import axios from "axios";
import axios from "axios";
import custom from "./custom-axios";
const fetchAllXX = (page) => {
  return custom.get(`/xuat-xu/view-all?p=${page}`); // Call API
};
const postAddXuatXu = (ma, tenNuoc, TrangThai) => {
  return axios.post();
};
export { fetchAllXX };
